import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles({

  root: {
    '& > *': {
      margin: '1',
      width: '25ch',
    },
    minWidth: 275,
    margin:'auto',
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

export default function OutlinedCard() {
  const classes = useStyles();
  const bull = <span className={classes.bullet}>â€¢</span>;
  let mouse_ws = new WebSocket("ws://127.0.0.1:8000/ws/deposit/1/")
  mouse_ws.send(JSON.stringify({ 'user_id': 1, 'x': event.pageX, 'y': event.pageY }));

  // mouse_ws.test();
  return (
    <div className={classes.root}>

    <Card className={classes.root} variant="outlined">
      <CardContent>
        <Typography className={classes.title} color="textSecondary" gutterBottom>
          Word of the Day
        </Typography>
        <Typography variant="h5" component="h2">
          be{bull}nev{bull}o{bull}lent
        </Typography>
        <Typography className={classes.pos} color="textSecondary">
          adjective
        </Typography>
        <Typography variant="body2" component="p">
          well meaning and kindly.
          <br />
          {'"a benevolent smile"'}
        </Typography>
      </CardContent>
      <CardActions>
     <TextField className={classes.root} id="standard-basic" label="Standard" />
        <Button size="small">Buy</Button>
      </CardActions>
     <form className={classes.root} noValidate autoComplete="off">
     <Button className={classes.root}>Default</Button>
   </form>
    </Card>
    </div>
  );
}
